import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PropertyList = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        const response = await axios.get('https://real-estate12.p.rapidapi.com/listings/sale', {
          headers: {
            'x-rapidapi-host': 'real-estate12.p.rapidapi.com',
            'x-rapidapi-key': '2ee229faf0msh69f4f622b5db54dp15c587jsn0ec1e29629cd'
          },
          params: {
            country: 'us',  // Örneğin ABD'deki emlak verilerini çekmek için
            state: 'ca',  // Örneğin Kaliforniya'daki emlak verilerini çekmek için
            city: 'los angeles'  // Örneğin Los Angeles'taki emlak verilerini çekmek için
          }
        });
        setProperties(response.data.properties);
      } catch (error) {
        console.error('Error fetching properties', error);
      }
    };

    fetchProperties();
  }, []);

  return (
    <div>
      <h1>Emlak Listesi</h1>
      <ul>
        {properties.map(property => (
          <li key={property.id}>
            <h2>{property.title}</h2>
            <p>{property.description}</p>
            <p>Fiyat: {property.price}</p>
            <img src={property.thumbnail} alt={property.title} />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PropertyList;
